import react from 'react';
import { Container, Header, Button, Icon, Segment } from 'semantic-ui-react';
import Layout from '../../components/layout';

const HomepageHeading = (
    <Container text>
      <Header
        as='h1'
        content='Imagine-a-Company'
        inverted
        style={{
          fontSize:'4em',
          fontWeight: 'normal',
          marginBottom: 0,
          marginTop:'3em',
        }}
      />
      <Header
        as='h2'
        content='Do whatever you want when you want to.'
        inverted
        style={{
          fontSize: '1.7em',
          fontWeight: 'normal',
          marginTop:'1.5em',
        }}
      />
      <Button primary size='huge'>
        Get Started
        <Icon name='right arrow' />
      </Button>
    </Container>
  )


const success = () => {
    return (
        <Layout>
            <Segment
            textAlign='center'
            style={{ minHeight: 700, padding: '1em 0em' }}
            vertical>
                <Container text>
                <Header
                    as='h1'
                    content='Registration Successfull'
                    color='blue'
                    textAlign = 'center'
                    style={{
                    fontSize:'4em',
                    fontWeight: 'normal',
                    marginBottom: 0,
                    marginTop:'3em',
                    }}
                />
                <Header
                    as='h2'
                    content='Login again to access the account.'
                    textAlign = 'center'
                    color='grey'
                    style={{
                    fontSize: '1.7em',
                    fontWeight: 'normal',
                    marginTop:'1em',
                    }}
                />
                <Button primary size='massive' textAlign = 'center'>
                    Login

                </Button>
                </Container>
            </Segment>
        </Layout>
      )
}


export default success;
